import React from "react";
import "./Login.css"
function Login(){

    let submitForm=(e)=>{
        e.preventDefault();
        alert("hello");
    }

    return(
        <form className="login" onSubmit={submitForm} >
            <label >Username</label>
            <input type="text"  required/>
            <label >Password</label>
            <input type="password"  minLength={8}  required/>

            <button>Login</button>
            <p>Forgot Password?</p>

        </form>
    )
};
export default Login;
